import {useScript} from "../hooks/useScript.js"

function OpenLayersMap(props)
{
    return (
        <>
             useScript("./createOpenLayersMap.js")
            <div id={props.mapID} className="map"></div>

        </>
    );
}

export default OpenLayersMap;
